import React from 'react';
import { Link } from 'react-router-dom';
import './Footer.css'

function Footer() {
  return (
    <div className='footer-container'>
      <section className="footer-subscription">
        <p className="footer-subscription-heading">
        <h2>Footer</h2>
        </p>
      </section>
    </div>
  );
};

export default Footer;
